import { TopicWrapper, TopicItem } from '../style'

class Topic extends Component {
	render() {
		return (
			<TopicWrapper>
				<TopicItem>
				<img 
					alt=''
					className='topic-pic'
					src='#'
				/>
				社会热点
				</TopicItem>
			</TopicWrapper>
		)
	}
}

export default Topic;
